import ResumeActions from './ResumeActions';
import Skills from './components/Skills';
import Experience from './components/Experience';
import Education from './components/Education';
import ContactInfo from './components/ContactInfo'; // Import the ContactInfo component
import './resume.css';

function Resume() {
  return (
    <div className='resume'>
      <ResumeActions />

      <h1>IRMA MODZGVRISHVILI</h1>
      <p>Data Scientist | Machine Learning | NLP | SQL | Tableau | AWS | Python | Data Visualization | Deep Learning</p>

      <ContactInfo
        email="modzgvrishviliirma@gmail.com"
        phone="(347) 641-1970"
        github="https://github.com/IrmaGeo"
        linkedin="https://www.linkedin.com/in/irmamodzgvrishvili"
      />

      <Skills />
      <Experience />
      <Education />
    </div>
  );
}

export default Resume;
